import Link from 'next/link'

const Home = (props) => (
    <div>
        <h1>Countries of the World</h1>
        <style jsx>{`
      div {
        border-bottom: solid 1px lightgrey;
        padding-top: 2%;
        padding-left: 1%;
        background-color: azure;
      }
      h1 {
          display: inline-block;
          color: grey;
      }
    `}</style>
    </div>
)

export default Home
